# Read all required files with error handling

def read_file_content(filename):
    try:
        with open(filename, 'r') as f:
            return f.read()
    except FileNotFoundError:
        return ''

index_html_base = read_file_content(inputs.get('index_html_base_T001', 'index.html'))
features_section = read_file_content(inputs.get('features_section_T002', 'index.html'))
testimonials_section = read_file_content(inputs.get('testimonials_section_T003', 'index.html'))
footer = read_file_content(inputs.get('footer_T004', 'footer.html'))

# Extract parts from base
start_index = index_html_base.find('<body')
if start_index != -1:
    start_index = index_html_base.find('>', start_index) + 1
else:
    start_index = 0

end_index = index_html_base.find('</body>')
if end_index == -1:
    end_index = len(index_html_base)

base_content = index_html_base[start_index:end_index]

# Assemble
complete_html = index_html_base[:start_index] + features_section + testimonials_section + base_content + footer + index_html_base[end_index:]

# Ensure all sections integrate seamlessly
if '<body class="bg-gray-900 text-white">' in complete_html:
    complete_html = complete_html.replace('<body class="bg-gray-900 text-white">', '<body class="bg-gray-900 dark:bg-gray-900 text-white dark:text-white">')

# Write
with open('index.html', 'w') as f:
    f.write(complete_html)

return {'index_html_complete_T005': 'index.html', 'execution_result_T005': 'Combined hero, features, testimonials, and footer into a complete dark-themed index.html.'}

